INSERT INTO `learning` VALUES (1, 89, 999, '<p><strong>Pengertian Variabel</strong></p>\r\n<p>Variabel adalah suatu tempat yang berfungsi untuk menyimpan nilai atau&nbsp;<a href=\"https://www.belajarcpp.com/tutorial/konstanta/\">konstanta</a>. nilai tersebut biasanya di dapat dari masukan pengguna, programmer, lingkungan, atau merupakan hasil dari proses program.</p>\r\n<p>Variabel yang telah kita buat merupakan sebuah memori pada&nbsp;<a href=\"https://www.belajarcpp.com/tutorial/komputer/\">komputer</a>. Di dalam komputer, tepatnya pada memori komputer, sebenarnya terdapat banyak sekali memori yang tersusun yang memiliki alamat sebagai penanda memori. Alamat memori diwakili dengan&nbsp;<a href=\"https://www.belajarcpp.com/tutorial/sistem-bilangan/\">bilangan&nbsp;</a><em>hexadecimal</em>&nbsp;dan setiap alamat mewakili satu bit.</p>\r\n<p>Variabel adalah suatu tempat yang berfungsi untuk menyimpan nilai atau&nbsp;<a href=\"https://www.belajarcpp.com/tutorial/konstanta/\">konstanta</a>. nilai tersebut biasanya di dapat dari masukan pengguna, programmer, lingkungan, atau merupakan hasil dari proses program.</p>\r\n<p>Variabel yang telah kita buat merupakan sebuah memori pada&nbsp;<a href=\"https://www.belajarcpp.com/tutorial/komputer/\">komputer</a>. Di dalam komputer, tepatnya pada memori komputer, sebenarnya terdapat banyak sekali memori yang tersusun yang memiliki alamat sebagai penanda memori. Alamat memori diwakili dengan&nbsp;<a href=\"https://www.belajarcpp.com/tutorial/sistem-bilangan/\">bilangan&nbsp;</a><em>hexadecimal</em>&nbsp;dan setiap alamat mewakili satu bit.</p>\r\n<p><strong>Deklarasi Variabel</strong></p>\r\n<p>Deklarasi variabel adalah proses mendirikan atau pembuatan variabel dalam kode program. Untuk mendirikan variabel kita membutuhkan sebuah&nbsp;<a href=\"https://www.belajarcpp.com/tutorial/tipe-data/\">tipe data</a>&nbsp;yang berguna untuk mewakili bentuk nilai yang akan disimpan dan sebuah nama (<em><a href=\"https://www.belajarcpp.com/tutorial/identifier/\">identifier</a></em>) sebagai pengenal.</p>\r\n<p><u>Bentuk Penulisan</u></p>\r\n<div>\r\n<div id=\"highlighter_719294\" class=\"syntaxhighlighter cpp\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"cpp plain\">tipe_data identitas;</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p><u>Contoh Penulisan</u></p>\r\n<div>\r\n<div id=\"highlighter_189378\" class=\"syntaxhighlighter cpp\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"cpp color1 bold\">int</code> <code class=\"cpp plain\">umur;</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p>Pada contoh di atas kita nyatakan bahwa akan kita dirikan sebuah variabel yang dapat menyimpan data dalam bentuk&nbsp;<em>integer</em>&nbsp;dengan nama pengenal adalah&nbsp;<code>umur</code>.</p>\r\n<p>Anda dapat membuat variabel tanpa nilai atau anda juga bisa langsung menyertakan nilai pada saat deklarasi variabel, pemberial nilai saat deklarasi disebut sebagai&nbsp;<a href=\"https://www.belajarcpp.com/tutorial/inisialisasi/\">inisialisasi</a>.</p>\r\n<p><u>Bentuk Penulisan</u></p>\r\n<div>\r\n<div id=\"highlighter_507061\" class=\"syntaxhighlighter cpp\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"cpp plain\">Tipe_data identitas = inisialisasi;</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p><u>Contoh Penulisan</u></p>\r\n<div>\r\n<div id=\"highlighter_182468\" class=\"syntaxhighlighter cpp\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"cpp color1 bold\">int</code> <code class=\"cpp plain\">umur = 21;</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p>Sebuah deklarasi merupakan sebuah pernyataan, Setiap kali pendeklarasian variabel harus diakhiri dengan tanda titik koma&nbsp;<code>;</code>.</p>\r\n<p><em><strong>Peraturan Pembuatan Variabel</strong></em></p>\r\n<p>Dalam peraturan pemberian identitas variabel dapat terdiri dari huruf, angka dan karakter&nbsp;<code>_</code>. nama variabel harus dimulai dengan huruf atau tanda garis bawah&nbsp;<code>_</code>. dan juga huruf besar dan huruf kecil dalam pemrograman C++ akan dianggap beda meskipun memiliki nama yang sama karena C++ merupakan Bahasa Pemrograman&nbsp;<em>Case-Sensitive</em></p>\r\n<p>Ada satu peraturan lainnya dalam pemberian nama pada variabel yaitu tidak boleh menggunakan spasi saat penamaan variabel.</p>\r\n<p>tapi jika nama tersebut memiliki dua kata atau lebih dan ingin tetap menamakanya dengan kata terpisah supaya mudah dibaca, anda tidak bisa menulis namanya menggunakan spasi tapi anda bisa menggantikan spasi dengan tanda&nbsp;<code>_&nbsp;</code>. ini dapat mempermudah anda dalam pembacaan nama yang lebih dari 1 kata.</p>\r\n<p>Peraturan terakhir adalah nama variabel tidak boleh diawali dengan angka atau menggunakan operator aritmetika. contoh penulisan yang benar adalah:</p>\r\n<div>\r\n<div id=\"highlighter_938542\" class=\"syntaxhighlighter cpp\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n<div class=\"line number2 index1 alt1\">2</div>\r\n<div class=\"line number3 index2 alt2\">3</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"cpp plain\">belajarcpp</code></div>\r\n<div class=\"line number2 index1 alt1\"><code class=\"cpp plain\">belajar_cpp</code></div>\r\n<div class=\"line number3 index2 alt2\"><code class=\"cpp plain\">belajarCpp5</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Jenis Tipe Data</strong></p>\r\n<p>Dalam mendirikan sebuah variabel kita akan membutuhkan tipe data untuk menentukan bentuk dari nilai yang dapat disimpan dalam variabel tersebut. Tipe data variable secara umum bisa dibedakan menjadi tiga, yaitu:</p>\r\n<p><u><strong>Variabel Numerik:</strong></u>&nbsp;Memungkinkan pengguna menyimpan data dalam bentuk angka atau bilangan. Variabel numerik dapat dibagi menjadi beberapa bagian yaitu : Bilangan Bulat (<em>Integer</em>&nbsp;<code>int</code>), Bilangan Desimal Berpresisi Tunggal (<em>Floating Point</em>&nbsp;<code>float</code>). Bilangan Desimal Berpresisi Ganda (<em>Double Precision</em>&nbsp;<code>double</code>).</p>\r\n<p><strong>Variabel&nbsp;<em>Text</em>:</strong>&nbsp;memungkinkan pengguna untuk menyimpan data berbentuk karakter. Bahasa pemrograman C++ menyediakan beberapa tipe data untuk variabel jenis ini, seperti&nbsp;<code>char</code>&nbsp;(<em>Character</em>&nbsp;/ Karakter tunggal),&nbsp;<code>string</code>&nbsp;(kumpulan dari karakter atau kata) dll.</p>\r\n<p><strong><em>Boolean</em>:&nbsp;</strong>merupakan jenis yang hanya dapat mewakili satu dari dua pilihan yaitu 1 (<em>True</em>) atau 0 (<em>False</em>). Pada pemrograman C++ kita dapat gunakan tipe data jenis ini, dengan memberikan keyword&nbsp;<code>bool</code>.</p>\r\n</div>\r\n<p><strong>Pembuatan variabel :</strong></p>\r\n<div>\r\n<p><u>Contoh penulisan</u></p>\r\n<div>\r\n<div id=\"highlighter_526249\" class=\"syntaxhighlighter cpp\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n<div class=\"line number2 index1 alt1\">2</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"cpp color1 bold\">int</code> <code class=\"cpp plain\">x, i, p;</code></div>\r\n<div class=\"line number2 index1 alt1\"><code class=\"cpp color1 bold\">double</code> <code class=\"cpp plain\">a, b, c;</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p>Hal ini sangat berguna karena tidak memakan banyak baris dalam mendirikan banyak variabel.</p>\r\n<p><u>Contoh pendeklarasian banyak variable dengan Inisialisasi :</u></p>\r\n<div>\r\n<div id=\"highlighter_441598\" class=\"syntaxhighlighter cpp\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n<div class=\"line number2 index1 alt1\">2</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"cpp color1 bold\">int</code> <code class=\"cpp plain\">x=10, y=21;</code></div>\r\n<div class=\"line number2 index1 alt1\"><code class=\"cpp plain\">string nama =</code><code class=\"cpp string\">\"Belajar C++ \"</code><code class=\"cpp plain\">, website=&rdquo;belajarcpp.com&rdquo;;</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p><strong>Tabel Macam-macam Tipe Data.</strong></p>\r\n<table>\r\n<thead>\r\n<tr>\r\n<th>Tipe Data</th>\r\n<th>Bentuk Penulisan</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td><em>Boolean</em></td>\r\n<td><code>bool</code></td>\r\n</tr>\r\n<tr>\r\n<td><em>Character</em></td>\r\n<td><code>char</code></td>\r\n</tr>\r\n<tr>\r\n<td><em>String</em></td>\r\n<td><code>string</code></td>\r\n</tr>\r\n<tr>\r\n<td><em>Integer</em></td>\r\n<td><code>int</code></td>\r\n</tr>\r\n<tr>\r\n<td><em>Floating Point</em></td>\r\n<td><code>float</code></td>\r\n</tr>\r\n<tr>\r\n<td><em>Double Floating Point</em></td>\r\n<td><code>double</code></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><u>Bentuk Penulisan</u></p>\r\n<div>\r\n<div id=\"highlighter_457289\" class=\"syntaxhighlighter cpp\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"cpp plain\">tipedata nama_variable=inisialisasi;</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p><u>Contoh Penulisan:</u></p>\r\n<div>\r\n<div id=\"highlighter_700776\" class=\"syntaxhighlighter cpp\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n<div class=\"line number2 index1 alt1\">2</div>\r\n<div class=\"line number3 index2 alt2\">3</div>\r\n<div class=\"line number4 index3 alt1\">4</div>\r\n<div class=\"line number5 index4 alt2\">5</div>\r\n<div class=\"line number6 index5 alt1\">6</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"cpp color1 bold\">bool</code> <code class=\"cpp plain\">variabelBool = 0, variabel_boolean;</code></div>\r\n<div class=\"line number2 index1 alt1\"><code class=\"cpp color1 bold\">char</code> <code class=\"cpp plain\">variabelChar, variabel_char = </code><code class=\"cpp string\">\'a\'</code><code class=\"cpp plain\">;</code></div>\r\n<div class=\"line number3 index2 alt2\"><code class=\"cpp plain\">string variabelString = </code><code class=\"cpp string\">\"Belajar Cpp\"</code><code class=\"cpp plain\">, variabel_string;</code></div>\r\n<div class=\"line number4 index3 alt1\"><code class=\"cpp color1 bold\">int</code> <code class=\"cpp plain\">variabelInt, variabel_int = 9;</code></div>\r\n<div class=\"line number5 index4 alt2\"><code class=\"cpp color1 bold\">float</code> <code class=\"cpp plain\">variabelFloat = 20,9, variabel_float;</code></div>\r\n<div class=\"line number6 index5 alt1\"><code class=\"cpp color1 bold\">double</code> <code class=\"cpp plain\">variabelDouble, variabel_double = 90,0;</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n<p><u>Contoh Program</u></p>\r\n<div>\r\n<div id=\"highlighter_435667\" class=\"syntaxhighlighter cpp\">\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"gutter\">\r\n<div class=\"line number1 index0 alt2\">1</div>\r\n<div class=\"line number2 index1 alt1\">2</div>\r\n<div class=\"line number3 index2 alt2\">3</div>\r\n<div class=\"line number4 index3 alt1\">4</div>\r\n<div class=\"line number5 index4 alt2\">5</div>\r\n<div class=\"line number6 index5 alt1\">6</div>\r\n<div class=\"line number7 index6 alt2\">7</div>\r\n<div class=\"line number8 index7 alt1\">8</div>\r\n<div class=\"line number9 index8 alt2\">9</div>\r\n<div class=\"line number10 index9 alt1\">10</div>\r\n<div class=\"line number11 index10 alt2\">11</div>\r\n<div class=\"line number12 index11 alt1\">12</div>\r\n<div class=\"line number13 index12 alt2\">13</div>\r\n<div class=\"line number14 index13 alt1\">14</div>\r\n<div class=\"line number15 index14 alt2\">15</div>\r\n<div class=\"line number16 index15 alt1\">16</div>\r\n<div class=\"line number17 index16 alt2\">17</div>\r\n<div class=\"line number18 index17 alt1\">18</div>\r\n<div class=\"line number19 index18 alt2\">19</div>\r\n</td>\r\n<td class=\"code\">\r\n<div class=\"container\">\r\n<div class=\"line number1 index0 alt2\"><code class=\"cpp preprocessor\">#include &lt;iostream&gt;</code></div>\r\n<div class=\"line number2 index1 alt1\"><code class=\"cpp keyword bold\">using</code> <code class=\"cpp keyword bold\">namespace</code> <code class=\"cpp plain\">std;</code></div>\r\n<div class=\"line number3 index2 alt2\">&nbsp;</div>\r\n<div class=\"line number4 index3 alt1\"><code class=\"cpp color1 bold\">int</code> <code class=\"cpp plain\">main ()</code></div>\r\n<div class=\"line number5 index4 alt2\"><code class=\"cpp plain\">{</code></div>\r\n<div class=\"line number6 index5 alt1\"><code class=\"cpp comments\">// Pendeklarasian variabel:</code></div>\r\n<div class=\"line number7 index6 alt2\"><code class=\"cpp color1 bold\">int</code> <code class=\"cpp plain\">a, b = 2;</code></div>\r\n<div class=\"line number8 index7 alt1\"><code class=\"cpp color1 bold\">int</code> <code class=\"cpp plain\">hasil;</code></div>\r\n<div class=\"line number9 index8 alt2\">&nbsp;</div>\r\n<div class=\"line number10 index9 alt1\"><code class=\"cpp comments\">// Operasi</code></div>\r\n<div class=\"line number11 index10 alt2\"><code class=\"cpp plain\">a = 5; </code><code class=\"cpp comments\">//Assignment Operator bukan inisialisasi</code></div>\r\n<div class=\"line number12 index11 alt1\"><code class=\"cpp plain\">a = a + 1;</code></div>\r\n<div class=\"line number13 index12 alt2\"><code class=\"cpp plain\">hasil = a - b;</code></div>\r\n<div class=\"line number14 index13 alt1\">&nbsp;</div>\r\n<div class=\"line number15 index14 alt2\"><code class=\"cpp comments\">//Output hasil operasi di atas</code></div>\r\n<div class=\"line number16 index15 alt1\"><code class=\"cpp plain\">cout &lt;&lt;</code><code class=\"cpp string\">\"Hasil dari operasi variabel adalah :\"</code><code class=\"cpp plain\">&lt;&lt;hasil;</code></div>\r\n<div class=\"line number17 index16 alt2\">&nbsp;</div>\r\n<div class=\"line number18 index17 alt1\"><code class=\"cpp keyword bold\">return</code> <code class=\"cpp plain\">0;</code></div>\r\n<div class=\"line number19 index18 alt2\"><code class=\"cpp plain\">}</code></div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p><strong>Tugas :</strong></p>\r\n<p>Saat ini semua negara sedang menghadapi wabah covid19, dibutuhkan sebuah aplikasi yang bisa mendeteksi apakah seseorang terkena covid19 atau tidak. untuk mengetahui dia terkena covid19 adalah jika suhunya lebih dari 38 derajat celcius. coba buat program yang bisa menampung suhu dan tampilkan suhu tersebut..</p>\r\n</div>\r\n</div>\r\n<p><strong>NOTE<br />Anda bisa menggunakan compiler online yang disediakan SMK di link <a href=\"http://elearning.smkitasy-syadzili.sch.id/\">http://elearning.smkitasy-syadzili.sch.id/</a></strong></p>\r\n<p>&nbsp;</p>\r\n</div>', 2, NULL, 3, 'Variabel dan Tipe Data C++', '2020-06-17 18:04:31', 1, '1_HLGtY6O2vUHqIyEbWdmBgA.jpeg', 'A1', 'A1');
INSERT INTO `learning` VALUES (2, 89, 999, '<div>Salah satu permasalahan yang pasti akan dijumpai dalam pembuatan program adalah suatu percabangan. Percabangan yang dimaksud di sini tidak lain adalah suatu pemilihan statemen yang akan di eksekusi dimana pemilihan tersebut berdasarkan kondisi tertentu. Di dalam C++, terdapat 2 jenis struktur blok (blok program) yang digunakan untuk mengimplementasikan suatu percabangan, yaitu dengan menggunakan struktur if dan struktur switch. Struktur if sendiri pada artikel ini akan dibagi menjadi 4 yaitu : pernyataan if satu kondisi, pernyataan&nbsp;if dua kondisi / if-else, pernyataan&nbsp;if lebih dari dua kondisi / if-else majemuk dan pernyataan&nbsp;if bersarang / nested if.</div>\r\n<div>&nbsp;</div>\r\n<div>Statemen-statemen yang ada dalam sebuah blok percabangan akan dieksekusi hanya jika kondisi yang didefinisikan bernilai benar (terpenuhi). Artinya jika kondisi bernilai salah (tidak terpenuhi), maka statemen-statemen tersebut tidak akan dieksekusi atau akan diabaikan oleh compiler.</div>\r\n<div>&nbsp;</div>\r\n<div>Untuk memahami konsep percabangan, perhatikan kalimat dibawah ini:</div>\r\n<blockquote class=\"tr_bq\">\r\n<p>&nbsp;\"Jika Budi mendapat ranking satu maka Budi akan dibelikan sepatu baru\"</p>\r\n</blockquote>\r\n<div>Coba sobat amati, pada kalimat diatas yang merupakan kondisi adalah mendapat ranking satu. Pada kasus ini sepatu baru hanya akan dibeli jika Budi mendapat ranking satu. Sebaliknya, jika tidak mendapat ranking satu, maka sepatu baru pun tidak akan dibelikan.</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<p><strong>Macam-macam operator yang digunakan.</strong></p>\r\n<p><strong>Operator Relasi</strong>&nbsp;- Operator ini digunakan untuk membandingkan 2 buah data untuk mendepatkan kondisi benar (TRUE) atau salah (FALSE). Berikut daftarnya:</p>\r\n<table>\r\n<thead>\r\n<tr>\r\n<th>Operator</th>\r\n<th>Keterangan</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>==</td>\r\n<td>Sama dengan</td>\r\n</tr>\r\n<tr>\r\n<td>!=</td>\r\n<td>Tidak sama dengan</td>\r\n</tr>\r\n<tr>\r\n<td>&lt;</td>\r\n<td>Kurang dari</td>\r\n</tr>\r\n<tr>\r\n<td>&gt;</td>\r\n<td>Lebih dari</td>\r\n</tr>\r\n<tr>\r\n<td>&lt;=</td>\r\n<td>Kurang dari atau sama dengan</td>\r\n</tr>\r\n<tr>\r\n<td>&gt;=</td>\r\n<td>Lebih dari atau sama dengan</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Operator Logika</strong>&nbsp;- Faktanya, terkadang kita dihadapkan kondisi yang memiliki lebih dari satu syarat. Jika anda mengalami hal yang sama maka gunakan operator berikut:</p>\r\n<table>\r\n<thead>\r\n<tr>\r\n<th>Operator</th>\r\n<th>Keterangan</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>&amp;&amp;</td>\r\n<td>And (Semua kondisi harus bernilai benar)</td>\r\n</tr>\r\n<tr>\r\n<td>||</td>\r\n<td>Or (Salah satu harus bernilai benar)</td>\r\n</tr>\r\n<tr>\r\n<td>!</td>\r\n<td>Not (Kebalikan dari kondisi sebenarnya)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div>\r\n<div>\r\n<h2>1. Pernyataan IF Satu Kondisi</h2>\r\n<p>Seperti yang sudah kita ketahui, pernyataan percabangan dipakai untuk memecahkan persoalan dengan cara mengambil suatu keputusan dari berbagai pernyataan yang ada. Untuk keperluan pengambilan keputusan, Dev-C++ menyediakan beberapa perintah salah satunya adalah if satu kondisi. Pernyataan if satu kondisi mempunyai pengertian, \"Jika kondisi bernilai benar, maka perintah akan dikerjakan dan jika kondisi bernilai salah, maka perintah akan diabaikan\".</p>\r\n</div>\r\n<div>&nbsp;</div>\r\n<ul>\r\n<li>Jika kondisi bernilai benar, maka perintah akan dikerjakan.</li>\r\n<li>Jika kondisi bernilai salah, maka perintah tidak akan dikerjakan</li>\r\n</ul>\r\n<div>Pengertian tersebut dapat dicerminkan melalui diagram alir berikut ini:</div>\r\n<table class=\"tr-caption-container\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a href=\"https://3.bp.blogspot.com/-DqIL6POdmqA/WQyd2hpXa8I/AAAAAAAAAgg/k6UdoguQWREYtc3fB-INUtOFce5KvKvuwCLcB/s1600/diagram%2Balir%2Bpernyataan%2Bif.JPG\"><img title=\"diagram alir pernyataan if satu kondisi\" src=\"https://3.bp.blogspot.com/-DqIL6POdmqA/WQyd2hpXa8I/AAAAAAAAAgg/k6UdoguQWREYtc3fB-INUtOFce5KvKvuwCLcB/s400/diagram%2Balir%2Bpernyataan%2Bif.JPG\" alt=\"diagram alir pernyataan if satu kondisi\" width=\"318\" height=\"400\" border=\"0\" /></a></td>\r\n</tr>\r\n<tr>\r\n<td class=\"tr-caption\">Diagram alir pernyataan if satu kondisi</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div>&nbsp;</div>\r\n<div><strong>Struktur If Satu Kondisi</strong></div>\r\n<div>Struktur if satu kondisi merupakan struktur yang paling sederhana karena hanya melibatkan sebuah ekspresi yang akan diperiksa.</div>\r\n<div>&nbsp;</div>\r\n<div>Bentuk umum dari struktur percabangan if satu kondisi adalah sebagai berikut:</div>\r\n<div>\r\n<blockquote class=\"tr_bq\">\r\n<p>&nbsp;// Jika terdapat lebih dari satu pernyataan / statemen<br />if (kondisi){<br />Statemen/Pernyataan;<br />Statemen/Pernyataan;<br />}</p>\r\n<p>// Jika hanya terdapat satu statemen<br />// Dapat ditulis sebagai berikut<br />if (kondisi) Statemen;</p>\r\n</blockquote>\r\n</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Contoh Program dengan Struktur If Satu Kondisi</strong></div>\r\n<div>\r\n<p>Berikut beberapa contoh program yang menerapkan struktur if satu kondisi seperti yang telah kami jelaskan diatas:</p>\r\n<table class=\"tr-caption-container\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a href=\"https://3.bp.blogspot.com/-BnPVQhakg9I/WQ1Oh7jhxtI/AAAAAAAAAgw/p_ucl2J8yz8VEt2PkzP1Y5yTmjSyA36tQCLcB/s1600/Contoh%2BProgram%2BI%2Bdengan%2BStruktur%2BIf%2BSatu%2BKondisi.JPG\"><img title=\"Contoh Program I dengan Struktur If Satu Kondisi\" src=\"https://3.bp.blogspot.com/-BnPVQhakg9I/WQ1Oh7jhxtI/AAAAAAAAAgw/p_ucl2J8yz8VEt2PkzP1Y5yTmjSyA36tQCLcB/s400/Contoh%2BProgram%2BI%2Bdengan%2BStruktur%2BIf%2BSatu%2BKondisi.JPG\" alt=\"Contoh Program I dengan Struktur If Satu Kondisi\" width=\"400\" height=\"186\" border=\"0\" /></a></td>\r\n</tr>\r\n<tr>\r\n<td class=\"tr-caption\">Contoh Program I dengan Struktur If Satu Kondisi</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<blockquote class=\"tr_bq\">\r\n<p>&nbsp;#include &lt;iostream&gt;</p>\r\n<p>using namespace std;</p>\r\n<p>int main()<br />{<br />int bilangan;</p>\r\n<p>// Memberikan informasi agar user memasukkan<br />// Sebuah bilangan bulat<br />cout&lt;&lt;\"\\t== Program Bilangan Positif ==\\n\\n\";<br />cout&lt;&lt;\"Masukkan bilangan : \";</p>\r\n<p>// Membaca nilai yang dimasukkan dari keyboard<br />// Dan disimpan ke variabel Bilangan<br />cin&gt;&gt;bilangan;</p>\r\n<p>// Program ini merupakan contoh if satu kondisi<br />// Akan menampilkan sebuah teks jika<br />// Bilangan yang dimasukkan &gt; 0<br /><strong>&nbsp; &nbsp;</strong>if(bilangan &gt; 0){<br />cout&lt;&lt;\"\\nAnda memasukkan bilangan Positif\\n\";<br />cout&lt;&lt;\"Bilangan tersebut adalah \"&lt;&lt;bilangan;<br /><strong>}</strong></p>\r\n<p>return 0;<br />}</p>\r\n</blockquote>\r\n</div>\r\n<div>\r\n<h2>2. Pernyataan IF Dua Kondisi</h2>\r\n<div>\r\n<p>Struktur percabangan if dua kondisi / if-else sedikit lebih kompleks bila dibandingkan dengan struktur if yang hanya memiliki satu buah kondisi. Sebenarnya konsepnya juga sederhana, yaitu pada struktur jenis ini terdapat sebuah statemen khusus yang berfungsi untuk mengatasi kejadia apabila kondisi yang didefinisikan tersebut bernilai salah (tidak terpenuhi).</p>\r\n</div>\r\n<div>Artinya dalam pernyataan if dua kondisi \"Jika kondisi bernilai benar, maka perintah-1 akan dikerjakan dan jika kondisi bernilai salah (tidak terpenuhi) maka akan mengerjakan perintah-2\".</div>\r\n<div>&nbsp;</div>\r\n<div>Dari pengertian tersebut dapat dicerminkan melalui diagram alir berikut ini.</div>\r\n<table class=\"tr-caption-container\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a href=\"https://2.bp.blogspot.com/-0gVVnWXYIXM/WQ2LELGIMwI/AAAAAAAAAhQ/EbRPslqcTLMPAVdb5hC9E87Q8Fav2C2zQCLcB/s1600/diagram%2Balir%2Bpernyataan%2Bif%2Bdua%2Bkondisi.JPG\"><img title=\"diagram alir pernyataan if dua kondisi\" src=\"https://2.bp.blogspot.com/-0gVVnWXYIXM/WQ2LELGIMwI/AAAAAAAAAhQ/EbRPslqcTLMPAVdb5hC9E87Q8Fav2C2zQCLcB/s400/diagram%2Balir%2Bpernyataan%2Bif%2Bdua%2Bkondisi.JPG\" alt=\"diagram alir pernyataan if dua kondisi\" width=\"400\" height=\"365\" border=\"0\" /></a></td>\r\n</tr>\r\n<tr>\r\n<td class=\"tr-caption\">diagram alir pernyataan if dua kondisi</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div>&nbsp;</div>\r\n<div><strong>Struktur If Dua Kondisi (If Else)</strong></div>\r\n<div>Bentuk umum dari struktur percabangan dengan dua kondisi adalah sebagai berikut:</div>\r\n<blockquote class=\"tr_bq\">\r\n<p>&nbsp;if (kondisi){<br />Statemen_jika_kondisi_terpenuhi;<br />}<br />else{<br />Statemen_jika_kondisi_tidak_terpenuhi;<br />}</p>\r\n</blockquote>\r\n<div><strong>Contoh program dengan Struktur If Dua Kondisi (If Else)</strong></div>\r\n<div>Berikut beberapa contoh program yang menerapkan struktur if dua kondisi seperti yang telah kami jelaskan diatas:</div>\r\n<table class=\"tr-caption-container\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a href=\"https://2.bp.blogspot.com/-Q53W_QO9HoE/WQ2LEN8D-OI/AAAAAAAAAhU/aBmDplWyoykWHR8stXpoiW-5EeaHduJ7wCEw/s1600/Contoh%2BProgram%2BI%2Bdengan%2BStruktur%2BIf%2BDua%2BKondisi.JPG\"><img title=\"Contoh Program I dengan Struktur If Dua Kondisi\" src=\"https://2.bp.blogspot.com/-Q53W_QO9HoE/WQ2LEN8D-OI/AAAAAAAAAhU/aBmDplWyoykWHR8stXpoiW-5EeaHduJ7wCEw/s400/Contoh%2BProgram%2BI%2Bdengan%2BStruktur%2BIf%2BDua%2BKondisi.JPG\" alt=\"Contoh Program I dengan Struktur If Dua Kondisi\" width=\"400\" height=\"205\" border=\"0\" /></a></td>\r\n</tr>\r\n<tr>\r\n<td class=\"tr-caption\">Contoh Program I dengan Struktur If Dua Kondisi</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div>\r\n<blockquote class=\"tr_bq\">\r\n<p>&nbsp;#include &lt;iostream&gt;</p>\r\n<p>using namespace std;</p>\r\n<p>int main()<br />{<br />int bilangan;</p>\r\n<p>// Memberikan informasi agar user memasukkan<br />// Sebuah bilangan bulat<br />cout&lt;&lt;\"\\t== Program Bilangan Positif ==\\n\\n\";<br />cout&lt;&lt;\"Masukkan bilangan : \";</p>\r\n<p>// Membaca nilai yang dimasukkan dari keyboard<br />// Dan disimpan ke variabel Bilangan<br />cin&gt;&gt;bilangan;</p>\r\n<p>// Program ini merupakan contoh if dua kondisi<br />if(bilangan &gt; 0){<br />cout&lt;&lt;\"\\nAnda memasukkan bilangan Positif\\n\";<br />cout&lt;&lt;\"Bilangan tersebut adalah \"&lt;&lt;bilangan;<br />}<br />else{<br />cout&lt;&lt;\"\\nAnda memasukkan bilangan kurang dari 1\";<br />cout&lt;&lt;\"\\nBilangan tersebut adalah \"&lt;&lt;bilangan;<br />}</p>\r\n<p>return 0;<br />}</p>\r\n</blockquote>\r\n<h2>3. Pernyataan IF Lebih Dari Dua Kondisi</h2>\r\n<div>Struktur percabangan if lebih dari dua kondisi / if-else majemuk merupakan struktur percabangan yang biasanya membingunggkan para programmer pemula. Percabangan If-else majemuk sebenarnya merupakan pengembangan dari struktur if dua kondisi, karena percabangan ini akan menambahkan (menyisipkan) satu atau lebih kondisi ke dalamnya.<br /><img class=\"alignnone size-full wp-image-742\" src=\"https://smkitasy-syadzili.sch.id/wp-content/uploads/2020/02/Untitled-Diagram.jpg\" alt=\"\" width=\"341\" height=\"391\" /><br />Artinya dalam pernyataan if lebih dari dua kondisi: Jika kondisi1 bernilai benar, maka perintah-1 akan dikerjakan, jika kondisi1 salah maka akan mengecek kondisi2 dan jika kondisi2 bernilai benar, maka perintah-2 akan dikerjakan, jika kondisi2 juga salah maka akan mengecek kondisi berikutnya dan akan mengerjakan perintah pada struktur blok yang memiliki kondisi bernilai benar. Seandainya tidak ada kondisi yang bernilai benar, maka akan mengerjakan perintah yang berada pada struktur blok else. untuk lebih jelasnya mari kita perhatikan struktur if-else majemuk dibawah ini.<strong>Struktur If Lebih Dari Dua Kondisi / If-Else Majemuk</strong><br />Bentuk umum dari struktur percabangan If yang memiliki lebih dari dua kondisi adalah sebagai berikut:\r\n<blockquote class=\"tr_bq\">\r\n<p>&nbsp;if(kondisi1){<br />Statemen_jika_kondisi1_terpenuhi;<br />}<br />else if(kondisi2){<br />Statemen_jika_kondisi2_terpenuhi;<br />}<br />else if(kondisi3){<br />Statemen_jika_kondisi3_terpenuhi;<br />}<br />else if(kondisi4){<br />Statemen_jika_kondisi4_terpenuhi;<br />}<br />.....<br />else{<br />Statemen_jika_semua_kondisi_tidak_terpenuhi;<br />}</p>\r\n</blockquote>\r\n<p><strong>Contoh Program dengan Struktur If Lebih Dari Dua Kondisi / If-Else Majemuk</strong><br />Untuk lebih memahami konsep dari struktur percabangan if-else majemuk, berikut kami sajikan beberapa contoh program yang mengimplementasikan hal tersebut.</p>\r\n<table class=\"tr-caption-container\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><a href=\"https://4.bp.blogspot.com/-3FBx503uOlY/WQ874zaYq4I/AAAAAAAAAhk/7ur6USbfQxUQPy4DptDBtQ1Y3BHJCSAawCPcB/s1600/Contoh%2BProgram%2BI%2Bdengan%2BStruktur%2BIf%2BLebih%2BDari%2BDua%2BKondisi%2Batau%2BIf-Else%2BMajemuk.JPG\"><img title=\"Contoh Program I dengan Struktur If Lebih Dari Dua Kondisi atau If-Else Majemuk\" src=\"https://4.bp.blogspot.com/-3FBx503uOlY/WQ874zaYq4I/AAAAAAAAAhk/7ur6USbfQxUQPy4DptDBtQ1Y3BHJCSAawCPcB/s400/Contoh%2BProgram%2BI%2Bdengan%2BStruktur%2BIf%2BLebih%2BDari%2BDua%2BKondisi%2Batau%2BIf-Else%2BMajemuk.JPG\" alt=\"Contoh Program I dengan Struktur If Lebih Dari Dua Kondisi atau If-Else Majemuk\" width=\"400\" height=\"200\" border=\"0\" /></a></td>\r\n</tr>\r\n<tr>\r\n<td class=\"tr-caption\">Contoh Program I dengan Struktur If Lebih Dari Dua Kondisi atau If-Else Majemuk</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<blockquote class=\"tr_bq\">\r\n<p>&nbsp;#include &lt;iostream&gt;</p>\r\n<p>using namespace std;</p>\r\n<p>int main()<br />{<br />int bilangan;</p>\r\n<p>// Memberikan informasi agar user memasukkan<br />// Sebuah bilangan<br />cout&lt;&lt;\"\\t== Program Tentukan Bilangan ==\\n\\n\";<br />cout&lt;&lt;\"Masukkan bilangan : \";</p>\r\n<p>// Membaca nilai yang dimasukkan dari keyboard<br />// Dan disimpan ke variabel Bilangan<br />cin&gt;&gt;bilangan;</p>\r\n<p>// Program ini merupakan<br />// Contoh if lebih dari dua kondisi<br />if(bilangan &gt; 0){<br />cout&lt;&lt;\"\\nAnda memasukan bilangan Positif\\n\";<br />cout&lt;&lt;\"Bilangan tersebut adalah \"&lt;&lt;bilangan;<br />}<br />else if (bilangan &lt; 0){<br />cout&lt;&lt;\"\\nAnda memasukan bilangan Negatif\\n\";<br />cout&lt;&lt;\"Bilangan tersebut adalah \"&lt;&lt;bilangan;<br />}<br />else{<br />cout&lt;&lt;\"\\nAnda memasukkan bilangan NOL\\n\";<br />}</p>\r\n<p>return 0;<br />}</p>\r\n</blockquote>\r\n</div>\r\n<div>\r\n<h2>4. Pernyataan IF Bersarang</h2>\r\n<div>Struktur percabangan if bersarang / nested if merupakan struktur if yang paling komplek, karena merupakan perluasan dan kombinasi dari berbagai struktur if lainnya. Konsep dari percabangan ini adalah terdapat Struktur If yang berada didalam Struktur If lainnya. Artinya dalam pernyataan If bersarang jika kondisi If yang paling luar (paling atas) bernilai benar, maka kondisi If yang berada didalamnya baru akan dilihat (di cek).<br /><img class=\"alignnone size-full wp-image-743\" src=\"https://smkitasy-syadzili.sch.id/wp-content/uploads/2020/02/Untitled-Diagram-1.jpg\" alt=\"\" width=\"458\" height=\"471\" /><br /><strong>Struktur If Bersarang / Nested If</strong><br />Bentuk umum dari struktur If bersarang / &nbsp;struktur if yang berada di dalam struktur if lainnya adalah sebagai berikut:</div>\r\n</div>\r\n<div>\r\n<blockquote class=\"tr_bq\">\r\n<p>&nbsp;if(kondisi1){<br />if(kondisi1a){<br />Statemen_jika_kondisi1_dan_1a_terpenuhi;<br />}<br />else if(kondisi1b){<br />Statemen_jika_kondisi1_dan_1b_terpenuhi;<br />}<br />.....<br />else{<br />Statemen_jika_hanya_kondisi1_yang_terpenuhi;<br />}<br />}<br />else if(kondisi2){<br />if(kondisi2a){<br />Statemen_jika_kondisi2_dan_2a_terpenuhi;<br />}<br />else if(kondisi2b){<br />Statemen_jika_kondisi2_dan_2b_terpenuhi;<br />}<br />.....<br />else{<br />Statemen_jika_hanya_kondisi2_yang_terpenuhi;<br />}<br />}<br />else if(kondisi3){<br />Statemen_jika_kondisi3_terpenuhi;<br />}<br />.....<br />else{<br />Statemen_jika_semua_kondisi_tidak_terpenuhi;<br />}</p>\r\n</blockquote>\r\n</div>\r\n<h2>5. Pernyataan Switch-Case</h2>\r\n<div>Selain menggunakan pernyataan If, C++ juga menawarkan kepada kita untuk dapat melakukan percabangan (pemilihan) dengan menggunakan pernyataan Switch-Case.</div>\r\n<div>Sama seperti pernyataan If-Else, pernyataan Switch-Case juga merupakan pernyataan yang digunakan untuk menjalankan salah satu pernyataan dari beberapa kemungkinan pernyataan, Namun penggunaan pernyataan Switch-Case lebih sempit, karena perintah ini haya digunakan untuk memeriksa data yang bertipe integer atau karakter.</div>\r\n<p><strong>Struktur Switch-Case</strong><br />Bentuk umum penggunaan pernyataan Switch-Case adalah sebagai berikut:</p>\r\n<blockquote class=\"tr_bq\">\r\n<p>&nbsp;switch(ekspresi){<br />case nilai_konstanta1:<br />Statemen_atau_Perintah;<br />break;<br />case nilai_konstanta2:<br />Statemen_atau_Perintah;<br />break;<br />case nilai_konstanta3:<br />Statemen_atau_Perintah;<br />break;<br />.....<br />case nilai_konstantaN:<br />Statemen_atau_Perintah;<br />break;<br />default:<br />Statemen_alternatif;<br />}</p>\r\n</blockquote>\r\n</div>\r\n<p>Sumber : http://www.materidosen.com/2017/05/5-macam-operasi-percabangan-c-lengkap.html</p>\r\n</div>\r\n</div>', 2, NULL, 3, 'Percabangan C++', '2020-06-17 18:04:31', 1, '1_HLGtY6O2vUHqIyEbWdmBgA.jpeg', 'a2', 'a2');
INSERT INTO `learning` VALUES (3, 89, 999, '<p>Apa yang akan kamu lakukan saat disuruh mencetak kalimat berulang-ulang?</p>\r\n<p>Misalnya:</p>\r\n<p>Tolong tampilkan kalimat&nbsp;<code>\"Tutorial Pemrograman C++!\"</code>&nbsp;sebanyak 10x ke layar!</p>\r\n<p>Mungkin kamu akan menggunakan&nbsp;<code>cout</code>&nbsp;sebanyak 10 kali seperti ini:</p>\r\n<div class=\"highlight\">\r\n<pre><code class=\"language-cpp\" data-lang=\"cpp\">#include &lt;iostream&gt;\r\nusing namespace std;\r\n\r\nint main(){\r\n    cout &lt;&lt; \"Tutorial Pemrograman C++!\" &lt;&lt; endl;\r\n    cout &lt;&lt; \"Tutorial Pemrograman C++!\" &lt;&lt; endl;\r\n    cout &lt;&lt; \"Tutorial Pemrograman C++!\" &lt;&lt; endl;\r\n    cout &lt;&lt; \"Tutorial Pemrograman C++!\" &lt;&lt; endl;\r\n    cout &lt;&lt; \"Tutorial Pemrograman C++!\" &lt;&lt; endl;\r\n    cout &lt;&lt; \"Tutorial Pemrograman C++!\" &lt;&lt; endl;\r\n    cout &lt;&lt; \"Tutorial Pemrograman C++!\" &lt;&lt; endl;\r\n    cout &lt;&lt; \"Tutorial Pemrograman C++!\" &lt;&lt; endl;\r\n    cout &lt;&lt; \"Tutorial Pemrograman C++!\" &lt;&lt; endl;\r\n    cout &lt;&lt; \"Tutorial Pemrograman C++!\" &lt;&lt; endl;\r\n    return 0;\r\n}\r\n</code></pre>\r\n</div>\r\n<p>Hasilnya:</p>\r\n<p><img class=\"blur-up lazyload mb-3 img-fluid lazyloaded\" src=\"https://www.petanikode.com/img/cpp/loop/manual-loop.png\" alt=\"Perulangan manual dengan printf\" data-sizes=\"auto\" data-src=\"/img/cpp/loop/manual-loop.png\" /></p>\r\n<p>Apakah boleh seperti ini?</p>\r\n<p>Ya, boleh-boleh saja.</p>\r\n<p>Tapi&hellip;</p>\r\n<p>Bagaimana kalau nanti mau menampilkan sebanyak&nbsp;<code>1000</code>&nbsp;kali.</p>\r\n<p>Pasti capek donk ngetiknya.</p>\r\n<p>Karena itu, kita harus menggunakan&nbsp;<strong>perulangan</strong>.</p>\r\n<div class=\"my-5 adsense blur-up lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazy