lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded lazyloaded\">&nbsp;</div>\r\n<p>Perulangan akan membantu kita mengeksekusi kode yang berulang-ulang, berapapun yang kita mau.</p>\r\n<p>Ada empat macam bentuk perulangan pada C.</p>\r\n<p>Secara umum, dibagi menjadi dua kelompok.</p>\r\n<p>Yaitu:&nbsp;<em>counted loop</em>&nbsp;dan&nbsp;<em>uncounted loop</em>.</p>\r\n<p>Perbedaanya:</p>\r\n<ul>\r\n<li><strong>Counted Loop</strong>&nbsp;merupakan perulangan yang jelas dan sudah tentu banyak kali perulangannya.</li>\r\n<li>Sedangkan&nbsp;<strong>Uncounted Loop</strong>, merupakan perulangan yang tidak jelas berapa kali ia harus mengulang.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Perulangan yang termasuk dalam&nbsp;<em>Counted Loop</em>:</p>\r\n<ol>\r\n<li>Perulangan For</li>\r\n</ol>\r\n<p>Perulangan yang termasuk dalam&nbsp;<em>Uncounted Loop</em>:</p>\r\n<ol>\r\n<li>Perulangan While</li>\r\n<li>Perulangan Do/While</li>\r\n</ol>\r\n<p>Mari kita bahas satu per satu&hellip;</p>\r\n<h2 id=\"1-blok-perulangan-for\">1. Blok Perulangan For</h2>\r\n<p>Perulangan&nbsp;<code>for</code>&nbsp;merupakan perulangan yang termasuk dalam&nbsp;<em>couted loop</em>, karena sudah jelas berapa kali ia akan mengulang.</p>\r\n<figure class=\"figure mb-3 img-thumbnail rounded-0\"><img class=\"lazyload blur-up figure-img img-fluid mb-0 lazyloaded\" src=\"https://www.petanikode.com/img/c/loop/flowchart-for.webp\" alt=\"Flowchart perulangan for\" data-src=\"/img/c/loop/flowchart-for.webp\" />\r\n<figcaption class=\"figure-caption text-center my-2\">Flowchart perulangan for</figcaption>\r\n</figure>\r\n<p>Bentuknya kodenya seperti ini:</p>\r\n<div class=\"highlight\">\r\n<pre><code class=\"language-c\" data-lang=\"c\">for(int i = 0; i &lt; 10; i++){\r\n    printf(\"Perulangan ke-%i\\n\", i);\r\n}\r\n</code></pre>\r\n</div>\r\n<p>Yang perlu diperhatikan adalah kondisi yang ada di dalam kurung setelah kata&nbsp;<code>for</code>.</p>\r\n<p>Kondisi ini akan menentukan:</p>\r\n<ul>\r\n<li>Hitungan akan dimulai dari&nbsp;<code>0</code>&nbsp;(<code>i = 0</code>);</li>\r\n<li>Hitungannya sampai berapa? Sampai&nbsp;<code>i &lt; 10</code>;</li>\r\n<li>Lalu di setiap perulangan&nbsp;<code>i</code>&nbsp;akan bertambah&nbsp;<code>+1</code>&nbsp;(<code>i++</code>).</li>\r\n</ul>\r\n<p>Variabel&nbsp;<code>i</code>&nbsp;pada perulangan&nbsp;<code>for</code>&nbsp;berfungsi untuk menyimpan nilai hitungan.</p>\r\n<p>Jadi setiap perulangan dilakukan nilai&nbsp;<code>i</code>&nbsp;akan selalu bertambah satu. Karena kita menentukannya di bagian&nbsp;<code>i++</code>.</p>\r\n<p>Contoh program loop dengan for:</p>\r\n<div class=\"highlight\">\r\n<pre><code class=\"language-cpp\" data-lang=\"cpp\">#include &lt;iostream&gt;\r\nusing namespace std;\r\n\r\nint main(){\r\n    for(int i = 0; i &lt; 10; i++){\r\n        printf(\"Perulangan ke-%i\\n\", i);\r\n    }\r\n\r\n    return 0;\r\n}\r\n</code></pre>\r\n</div>\r\n<p>Ini hasil outputnya:</p>\r\n<p><img class=\"blur-up lazyload mb-3 img-fluid lazyloaded\" src=\"https://www.petanikode.com/img/c/loop/for-loop.webp\" alt=\"Perulangan For pada bahasa C\" data-sizes=\"auto\" data-src=\"/img/c/loop/for-loop.webp\" /></p>\r\n<p>Apakah nama variabelnya harus selalu&nbsp;<code>i</code>?</p>\r\n<p>Tidak.</p>\r\n<p>Kita juga bisa menggunakan nama lain.</p>\r\n<p>Misalnya:</p>\r\n<div class=\"highlight\">\r\n<pre><code class=\"language-cpp\" data-lang=\"cpp\">#include &lt;iostream&gt;\r\nusing namespace std;\r\n\r\nint main(){\r\n    for(int counter = 0; counter &lt; 10; counter += 2){\r\n        printf(\"Perulangan ke-%i\\n\", counter);\r\n    }\r\n\r\n    return 0;\r\n}\r\n</code></pre>\r\n</div>\r\n<p>Pada contoh tersebut, kita melakukan perulangan dimulai dari nol&nbsp;<code>0</code>. Lalu di setiap perulangan nilai variabel&nbsp;<code>couter</code>&nbsp;akan ditambah 2 (<code>counter+=2</code>).</p>\r\n<p>Hasilnya:</p>\r\n<p><img class=\"blur-up lazyload mb-3 img-fluid lazyloaded\" src=\"https://www.petanikode.com/img/cpp/loop/for-2.png\" alt=\"Perulangan For pada bahasa C++\" data-sizes=\"auto\" data-src=\"/img/cpp/loop/for-2.png\" /></p>\r\n<p>Bagaimana kalau&nbsp;<em>counter</em>&nbsp;perulangannya dimulai dari akanga yang lebih besar sampai yang ke paling kecil?</p>\r\n<p>Ini biasanya kita buat saat ingin menghitung mundur&hellip;</p>\r\n<p>Caranya gampang.</p>\r\n<p>Kita tinggal isi nilai counter dengan nilai terbesarnya.</p>\r\n<p>Misalnya kita akan mulai hitungan dari&nbsp;<code>10</code>&nbsp;sampai ke&nbsp;<code>0</code>.</p>\r\n<p>Maka nilai&nbsp;<code>counter</code>, kita isi awalnya dengan&nbsp;<code>10</code>.</p>\r\n<p>Lalu di kondisi perbandingannya, kita berikan&nbsp;<code>counter &gt; 0</code>. Artinya perulangan akan dilakukan selama nilai counter lebih besar dari&nbsp;<code>0</code>.</p>\r\n<p>Lalu kita kurangi (<code>-1</code>) nilai counter di setiap perulangan (<code>counter--</code>).</p>\r\n<div class=\"highlight\">\r\n<pre><code class=\"language-cpp\" data-lang=\"cpp\">for(int counter = 10; counter &gt; 0; counter--){\r\n    printf(\"Perulangan ke-%i\\n\", counter);\r\n}\r\n</code></pre>\r\n</div>\r\n<p>Hasilnya:</p>\r\n<p><img class=\"blur-up lazyload mb-3 img-fluid lazyloaded\" src=\"https://www.petanikode.com/img/c/loop/for-downto.webp\" alt=\"Perulangan for dengan hitung mundur\" data-sizes=\"auto\" data-src=\"/img/c/loop/for-downto.webp\" /></p>\r\n<p>Mengapa tidak sampai nol (<code>0</code>)?</p>\r\n<p>Karena kondisi yang kita berikan&nbsp;<code>counter &gt; 0</code>. Apabila&nbsp;<code>counter</code>&nbsp;bernilai&nbsp;<code>0</code>, maka kondisi ini akan menjadi&nbsp;<code>false</code>.</p>\r\n<p>Kecuali kita menggunakan operator lebih besar sama dengan (<code>&gt;=</code>), maka jika&nbsp;<code>counter</code>&nbsp;bernilai&nbsp;<code>0</code>, kondisi akan menjadi&nbsp;<code>true</code>.</p>\r\n<h2 id=\"2-perulangan-while-pada-c\">2. Perulangan While pada C++</h2>\r\n<p>Perulangan&nbsp;<code>while</code>&nbsp;merupakan perulangan yang termasuk dalam perulangan&nbsp;<em>uncounted loop</em>.</p>\r\n<p>Perulangan&nbsp;<code>while</code>&nbsp;juga dapat menjadi perulangan yang&nbsp;<em>counted loop</em>&nbsp;dengan memberikan&nbsp;<em>counter</em>&nbsp;di dalamnya.</p>\r\n<p>Bentuk flow chart-nya sama seperti&nbsp;<em>flow chart for</em>.</p>\r\n<figure class=\"figure mb-3 img-thumbnail rounded-0\"><img class=\"lazyload blur-up figure-img img-fluid mb-0 lazyloaded\" src=\"https://www.petanikode.com/img/c/loop/flowchart-for.webp\" alt=\"Flowchart perulangan while\" data-src=\"/img/c/loop/flowchart-for.webp\" />\r\n<figcaption class=\"figure-caption text-center my-2\">Flowchart perulangan while</figcaption>\r\n</figure>\r\n<p>Untuk memahami perulangan ini&hellip;</p>\r\n<p>&hellip;mari kita coba lihat contohnya:</p>\r\n<div class=\"highlight\">\r\n<pre><code class=\"language-cpp\" data-lang=\"cpp\">#include &lt;iostream&gt;\r\nusing namespace std;\r\n\r\nint main(){\r\n    char ulangi = \'y\';\r\n    int counter = 0;\r\n\r\n    // perulangan while\r\n    while(ulangi == \'y\'){\r\n        printf(\"Apakah kamu mau mengulang?\\n\");\r\n        printf(\"Jawab (y/t): \");\r\n        cin &gt;&gt; ulangi;\r\n\r\n        // increment counter\r\n        counter++;\r\n    }\r\n\r\n    printf(\"\\n\\n----------\\n\");\r\n    printf(\"Perulangan Selesai!\\n\");\r\n    printf(\"Kamu mengulang sebanyak %i kali.\\n\", counter);\r\n\r\n    return 0;\r\n}\r\n</code></pre>\r\n</div>\r\n<p>Hasilnya:</p>\r\n<p><img class=\"blur-up lazyload mb-3 img-fluid lazyloaded\" src=\"https://www.petanikode.com/img/c/loop/while.webp\" alt=\"Perulangan while pada C++\" data-sizes=\"auto\" data-src=\"/img/c/loop/while.webp\" /></p>\r\n<p>Coba perhatikan blok kode&nbsp;<code>while</code>:</p>\r\n<div class=\"highlight\">\r\n<pre><code class=\"language-cpp\" data-lang=\"cpp\">// perulangan while\r\nwhile(ulangi == \'y\'){\r\n    printf(\"Apakah kamu mau mengulang?\\n\");\r\n    printf(\"Jawab (y/t): \");\r\n    cin &gt;&gt; ulangi;\r\n    // increment counter\r\n    counter++;\r\n}\r\n</code></pre>\r\n</div>\r\n<p>Di sana&hellip; Perulangan akan terjadi selama variabel&nbsp;<code>ulangi</code>&nbsp;brenilai&nbsp;<code>y</code>.</p>\r\n<p>Lalu kita menggunakan fungsi&nbsp;<code>scanf()</code>&nbsp;untuk mengambil input.</p>\r\n<p>Selama kita menjawab&nbsp;<strong>y</strong>&nbsp;pada input, maka perulangan akan terus dilakukan.</p>\r\n<p>Tapi kalau kita jawab yang lain, maka perulangan akan dihentikan.</p>\r\n<p>Karena kondisi perulangannya tidak terpenuhi.</p>\r\n<h2 id=\"3-perulangan-dowhile-pada-c\">3. Perulangan Do/While pada C++</h2>\r\n<p>Perulangan&nbsp;<code>do/while</code>&nbsp;sama seperti perulangan&nbsp;<code>while</code>.</p>\r\n<p>Perbedaanya:</p>\r\n<p>Perulangan&nbsp;<code>do/while</code>&nbsp;akan melakukan perulangan sebanyak&nbsp;<code>1</code>&nbsp;kali terlebih dahulu, lalu mengecek kondisi yang ada di dalam kurung&nbsp;<code>while</code>.</p>\r\n<p>Flow chart perulangan do/while:</p>\r\n<p><img class=\"blur-up lazyload mb-3 img-fluid lazyloaded\" src=\"https://www.petanikode.com/img/c/loop/flowchart-dowhile.webp\" alt=\"Flowchart perulangan do/while\" data-sizes=\"auto\" data-src=\"/img/c/loop/flowchart-dowhile.webp\" /></p>\r\n<p>Bentuk kodenya seperti ini:</p>\r\n<div class=\"highlight\">\r\n<pre><code class=\"language-javascript\" data-lang=\"javascript\">do {\r\n    // blok kode yang akan diulang\r\n} while (&lt;kondisi&gt;);\r\n</code></pre>\r\n</div>\r\n<p>Jadi perbedaanya:</p>\r\n<blockquote>\r\n<p>Perulangan&nbsp;<code>do/while</code>&nbsp;akan mengecek kondisi di belakang (sesudah mengulang), sedangkan&nbsp;<code>while</code>&nbsp;akan mencek kondisi di depan atau awal (sbelum mengulang).</p>\r\n</blockquote>\r\n<p>Mari kita coba lihat contohnya:</p>\r\n<div class=\"highlight\">\r\n<pre><code class=\"language-cpp\" data-lang=\"cpp\">#include &lt;iostream&gt;\r\nusing namespace std;\r\n\r\nint main(){\r\n    char ulangi = \'y\';\r\n    int counter = 0;\r\n\r\n    do {\r\n        printf(\"Apakah kamu mau mengulang?\\n\");\r\n        printf(\"Jawab (y/t): \");\r\n        cin &gt;&gt; ulangi;\r\n\r\n        // increment counter\r\n        counter++;\r\n    } while(ulangi == \'y\');\r\n\r\n    printf(\"\\n\\n----------\\n\");\r\n    printf(\"Perulangan Selesai!\\n\");\r\n    printf(\"Kamu mengulang sebanyak %i kali.\\n\", counter);\r\n\r\n    return 0;\r\n}\r\n</code></pre>\r\n</div>\r\n<p>Contoh tersebut sama seperti contoh pada perulangan&nbsp;<code>while</code>.</p>\r\n<p>Saat perulangan pertama, cobalah untuk membatalkan perulangannya dengan menjawab&nbsp;<code>t</code>.</p>\r\n<p>Maka hasilnya:</p>\r\n<p><img class=\"blur-up lazyload mb-3 img-fluid lazyloaded\" src=\"https://www.petanikode.com/img/c/loop/do-while.webp\" alt=\"Perulangan Do While\" data-sizes=\"auto\" data-src=\"/img/c/loop/do-while.webp\" /></p>\r\n<h2 id=\"4-perulangan-bersarang-nested-loop\">4. Perulangan Bersarang&nbsp;<em>(Nested Loop)</em></h2>\r\n<p>Di dalam blok perulangan, kita juga dapat membuat perulangan.</p>\r\n<p>Ini disebut dengan&nbsp;<em>nested loop</em>&nbsp;atau perulangan bersarang atau perulangan di dalam perualangan.</p>\r\n<p>Mari kita coba lihat contohnya:</p>\r\n<div class=\"highlight\">\r\n<pre><code class=\"language-cpp\" data-lang=\"cpp\">#include &lt;iostream&gt;\r\nusing namespace std;\r\n\r\nint main(){\r\n    for(int i = 0; i &lt; 10; i++){\r\n        for(int j = 0; j &lt; 10; j++){\r\n            printf(\"Perulangan ke (%d, %d)\\n\", i, j);\r\n        }\r\n    }\r\n\r\n    return 0;\r\n}\r\n</code></pre>\r\n</div>\r\n<p>Hasilnya:</p>\r\n<p><img class=\"blur-up lazyload mb-3 img-fluid lazyloaded\" src=\"https://www.petanikode.com/img/c/loop/nested-loop.webp\" alt=\"Perulangan bersarang pada C++\" data-sizes=\"auto\" data-src=\"/img/c/loop/nested-loop.webp\" /></p>\r\n<p>Pada perulangan tersebut, kita menggunakan dua perulangan&nbsp;<code>for</code>.</p>\r\n<p>Perulangan pertama menggunakan variabel&nbsp;<code>i</code>&nbsp;sebagai&nbsp;<em>counter</em>, sedangkan perultangan kedua menggunakan variabel&nbsp;<code>j</code>&nbsp;sebagai&nbsp;<em>counter</em>.</p>\r\n<h2 id=\"apa-selanjutnya\">Apa Selanjutnya?</h2>\r\n<p>Intinya perulangan digunakan untuk melakukan pengulangan. Ini merupakan hal dasar yang harus dipahami setiap programmer.</p>\r\n<p>Karena ke depan, kita akan banyak menggunakannya dalam membuat program dengan C++.</p>\r\n<p>Yang perlu diingat, perulangan itu ada dua macam:&nbsp;<em>Counted loop</em>&nbsp;dan&nbsp;<em>uncounted loop</em>.</p>\r\n<p>Selamat belajar&hellip;</p>', 2, 'ASD123', 3, 'Perulangan C++', '2020-06-17 18:04:31', 1, '1_HLGtY6O2vUHqIyEbWdmBgA.jpeg', 'a3', 'a3');
INSERT INTO `learning` VALUES (4, 89, 999, '<p>Halo sahabat programmer, kali ini kita saya kembali membagikan contoh program&nbsp;<em><strong>bubble sort&nbsp;</strong></em>dengan&nbsp;<a href=\"https://kelasprogrammer.com/category/c/\">C++</a>. Mungkin ketika kalian belajar algoritma atau struktur data teknik&nbsp;<strong>pengurutan bubble sort</strong>&nbsp;ini akan kalian pelajari. Selain&nbsp;<strong><em>bubble sort</em></strong>&nbsp;masih terdapat banyak jenis pengurutan yang lain seperti&nbsp;<em>insertion sort, selection sort,merge sort</em>&nbsp;dan lainnya. Jika diperlukan akan saya bahas pada postingan-postingan selanjutnya.</p>\r\n<h2>Pengertian Pengurutan (Sorting)</h2>\r\n<p>Pengurutan atau&nbsp;<em>sorting&nbsp;</em>adalah suatu proses penyusunan data yang akan disusun menurut pola/aturan tertentu. Terdapat 2 bentuk pengurutan yang dilakukan yaitu:</p>\r\n<ul>\r\n<li>Pengurutan naik&nbsp;<em>(ascending)</em>&nbsp;mengurutkan data dari nilai yang terkecil atau yang terendah ke nilai yang lebih besar/tinggi.</li>\r\n<li>Pengurutan turun&nbsp;<em>(descending)</em>&nbsp;adalah kebalikan dari pengurutan ascending dimana data akan diurutkan dari yang terbesar ke yang terkecil.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h2>Algoritma Bubble Sort</h2>\r\n<p><strong>Metode Bubble sort</strong>&nbsp;adalah salah satu jenis algoritma pengurutan yang paling sederhana dan mudah baik dalam konsep dan penerapannya didalam program. Bubble sort terinspirasi dari namanya &lsquo;gelembung&rsquo; dimana berat jenis gelembung&nbsp;<strong>lebih kecil</strong>&nbsp;dari berat air sehingga akan mengapung&nbsp;<strong>diatas</strong>&nbsp;permukaan., lewat ilustrasi inilah metode bubble sort bekerja.</p>\r\n<h2>Cara Kerja Algoritma Bubble Sort</h2>\r\n<p><strong>Algoritma bubble sort</strong>&nbsp;bekerja dengan cara membandingkan data dari elemen data yang pertama dibandingkan tepat pada elemen berikutnya hingga elemen ke-n (n adalah banyaknya jumlah data). Bila saat dibandingkan terdapat nilai yang lebih kecil dari elemen pertama maka posisinya akan ditukar. Nilai tersebut akan terus dibandingkan hingga sampai pada elemen ke-n, ini menjadi&nbsp;<strong>iterasi/tahap pertama</strong>&nbsp;pada proses pengurutannya. Hasil pengurutan pada tahap pertama akan menjadi acuan pada iterasi tahap berikutnya dimana nilai pada elemen pertama tidak akan dibandingkan lagi dengan elemen yang lain. Pada tahap/iterasi kedua ini nilai pada elemen ke-2 akan dibandingkan dengan cara yang sama pada iterasi yang pertama. Iterasi akan terus dilakukan hingga nilai pada setiap elemen terurut sesuai aturan (dalam hal ini saya menggunakan aturan&nbsp;<em>ascending</em>).</p>\r\n<h3>Contoh:</h3>\r\n<pre class=\"wp-block-code prettyprinted\"><code class=\" prettyprinted\"><span class=\"pln\">data</span><span class=\"pun\">[</span><span class=\"lit\">1</span><span class=\"pun\">]=</span><span class=\"lit\">3</span><span class=\"pun\">;</span><span class=\"pln\">\r\ndata</span><span class=\"pun\">[</span><span class=\"lit\">2</span><span class=\"pun\">]=</span><span class=\"lit\">7</span><span class=\"pun\">;</span><span class=\"pln\">\r\ndata</span><span class=\"pun\">[</span><span class=\"lit\">3</span><span class=\"pun\">]=</span><span class=\"lit\">4</span><span class=\"pun\">;</span><span class=\"pln\">\r\ndata</span><span class=\"pun\">[</span><span class=\"lit\">4</span><span class=\"pun\">]=</span><span class=\"lit\">2</span><span class=\"pun\">;</span><span class=\"pln\">\r\ndata</span><span class=\"pun\">[</span><span class=\"lit\">5</span><span class=\"pun\">]=</span><span class=\"lit\">1</span><span class=\"pun\">;</span></code></pre>\r\n<p>Perhatikan diatas kita mempunyai 5 elemen data, kita akan coba urutkan dengan teknik bubble sort secara&nbsp;<em>ascending&nbsp;</em>lewat langkah-langkah berikut:</p>\r\n<ul>\r\n<li>Data[1] akan dibandingkan dengan data[2] jika nilai dari data[1] lebih besar dari data[2] maka posisinya akan ditukar.</li>\r\n<li>data[1] selanjutnya akan terus dibandingkan dengan data[3],data[4] dan data[5]. Apabila nilai dari data[1] lebih besar maka posisinya akan terus ditukar.</li>\r\n<li>Ketika data[1] telah selesai membandingkan dengan semua data yang ada, selanjutnya data[2] akan dibandingkan lagi dengan data[3],data[4] dan data[5]. cara kerjanya sama bila nilai pada data[2] lebih besar dengan data yang dibandingkan maka posisinya akan ditukar. Pada tahap ini data[1] sudah tidak dibandingkan lagi karena sudah mempati posisi pengurutan yang tepat.</li>\r\n<li>Proses pembandingan data akan terus berjalan hingga memenuhi urutan yang diinginkan.</li>\r\n</ul>\r\n<p>Artikel lainnya :&nbsp;<a title=\"Contoh program C++ Fungsi dan Prosedur\" href=\"https://kelasprogrammer.com/contoh-program-cpp-fungsi-dan-prosedur/\">Contoh program C++ Fungsi dan Prosedur</a></p>\r\n<h2>Implementasi Kedalam Program c++</h2>\r\n<pre class=\"wp-block-code prettyprinted\"><code class=\" prettyprinted\"><span class=\"com\">#include</span> <span class=\"str\">&lt;iostream&gt;</span>\r\n<span class=\"com\">#include</span> <span class=\"str\">&lt;conio.h&gt;</span>\r\n<span class=\"kwd\">using</span> <span class=\"kwd\">namespace</span><span class=\"pln\"> std</span><span class=\"pun\">;</span>\r\n    <span class=\"kwd\">int</span><span class=\"pln\"> data</span><span class=\"pun\">[</span><span class=\"lit\">10</span><span class=\"pun\">],</span><span class=\"pln\"> data2</span><span class=\"pun\">[</span><span class=\"lit\">10</span><span class=\"pun\">];</span>\r\n    <span class=\"kwd\">int</span><span class=\"pln\"> n</span><span class=\"pun\">;</span>\r\n    \r\n<span class=\"kwd\">int</span><span class=\"pln\"> tukar </span><span class=\"pun\">(</span><span class=\"kwd\">int</span><span class=\"pln\"> a</span><span class=\"pun\">,</span><span class=\"kwd\">int</span><span class=\"pln\"> b</span><span class=\"pun\">){</span>\r\n    <span class=\"kwd\">int</span><span class=\"pln\"> t</span><span class=\"pun\">;</span><span class=\"pln\">\r\n    t</span><span class=\"pun\">=</span><span class=\"pln\">data</span><span class=\"pun\">[</span><span class=\"pln\">b</span><span class=\"pun\">];</span><span class=\"pln\">\r\n    data</span><span class=\"pun\">[</span><span class=\"pln\">b</span><span class=\"pun\">]=</span><span class=\"pln\">data</span><span class=\"pun\">[</span><span class=\"pln\">a</span><span class=\"pun\">];</span><span class=\"pln\">\r\n    data</span><span class=\"pun\">[</span><span class=\"pln\">a</span><span class=\"pun\">]=</span><span class=\"pln\">t</span><span class=\"pun\">;</span>\r\n<span class=\"pun\">}</span>\r\n\r\n<span class=\"kwd\">int</span><span class=\"pln\"> input</span><span class=\"pun\">(){</span><span class=\"pln\">\r\n    cout</span><span class=\"pun\">&lt;&lt;</span><span class=\"str\">\"Masukan Jumlah Data = \"</span><span class=\"pun\">;</span><span class=\"pln\">\r\ncin</span><span class=\"pun\">&gt;&gt;</span><span class=\"pln\">n</span><span class=\"pun\">;</span><span class=\"pln\">\r\n\r\ncout</span><span class=\"pun\">&lt;&lt;</span><span class=\"pln\">endl</span><span class=\"pun\">;</span>\r\n    \r\n    <span class=\"kwd\">for</span> <span class=\"pun\">(</span><span class=\"kwd\">int</span><span class=\"pln\"> i</span><span class=\"pun\">=</span><span class=\"lit\">0</span><span class=\"pun\">;</span><span class=\"pln\">i</span><span class=\"pun\">&lt;</span><span class=\"pln\">n</span><span class=\"pun\">;</span><span class=\"pln\">i</span><span class=\"pun\">++){</span><span class=\"pln\">\r\n    	cout</span><span class=\"pun\">&lt;&lt;</span><span class=\"str\">\"Masukan Data Ke-\"</span><span class=\"pun\">&lt;&lt;</span><span class=\"pln\">i</span><span class=\"pun\">+</span><span class=\"lit\">1</span><span class=\"pun\">&lt;&lt;</span><span class=\"str\">\" = \"</span><span class=\"pun\">;</span><span class=\"pln\">\r\n    	cin</span><span class=\"pun\">&gt;&gt;</span><span class=\"pln\">data</span><span class=\"pun\">[</span><span class=\"pln\">i</span><span class=\"pun\">];</span><span class=\"pln\">\r\n    	\r\n    	data2</span><span class=\"pun\">[</span><span class=\"pln\">i</span><span class=\"pun\">]=</span><span class=\"pln\">data</span><span class=\"pun\">[</span><span class=\"pln\">i</span><span class=\"pun\">];</span>\r\n	<span class=\"pun\">}</span><span class=\"pln\">\r\n	cout</span><span class=\"pun\">&lt;&lt;</span><span class=\"pln\">endl</span><span class=\"pun\">;</span>	\r\n<span class=\"pun\">}</span>\r\n\r\n<span class=\"kwd\">int</span><span class=\"pln\"> tampil</span><span class=\"pun\">(){</span>\r\n	<span class=\"kwd\">for</span> <span class=\"pun\">(</span><span class=\"kwd\">int</span><span class=\"pln\"> i</span><span class=\"pun\">=</span><span class=\"lit\">0</span><span class=\"pun\">;</span><span class=\"pln\">i</span><span class=\"pun\">&lt;</span><span class=\"pln\">n</span><span class=\"pun\">;</span><span class=\"pln\">i</span><span class=\"pun\">++){</span><span class=\"pln\">\r\n	     cout</span><span class=\"pun\">&lt;&lt;</span><span class=\"str\">\"[\"</span><span class=\"pun\">&lt;&lt;</span><span class=\"pln\">data</span><span class=\"pun\">[</span><span class=\"pln\">i</span><span class=\"pun\">]&lt;&lt;</span><span class=\"str\">\"] \"</span><span class=\"pun\">;</span>\r\n	<span class=\"pun\">}</span><span class=\"pln\">\r\n	cout</span><span class=\"pun\">&lt;&lt;</span><span class=\"pln\">endl</span><span class=\"pun\">;</span>\r\n<span class=\"pun\">}</span>\r\n\r\n<span class=\"kwd\">int</span><span class=\"pln\"> bubble_sort</span><span class=\"pun\">(){</span>\r\n	<span class=\"kwd\">for</span> <span class=\"pun\">(</span><span class=\"kwd\">int</span><span class=\"pln\"> i</span><span class=\"pun\">=</span><span class=\"lit\">1</span><span class=\"pun\">;</span><span class=\"pln\"> i</span><span class=\"pun\">&lt;</span><span class=\"pln\">n</span><span class=\"pun\">;</span><span class=\"pln\">i</span><span class=\"pun\">++){</span>\r\n		<span class=\"kwd\">for</span> <span class=\"pun\">(</span><span class=\"kwd\">int</span><span class=\"pln\"> j</span><span class=\"pun\">=</span><span class=\"pln\">n</span><span class=\"pun\">-</span><span class=\"lit\">1</span><span class=\"pun\">;</span><span class=\"pln\"> j</span><span class=\"pun\">&gt;=</span><span class=\"pln\">i</span><span class=\"pun\">;</span><span class=\"pln\">j</span><span class=\"pun\">--){</span>\r\n			<span class=\"kwd\">if</span> <span class=\"pun\">(</span><span class=\"pln\">data</span><span class=\"pun\">[</span><span class=\"pln\">j</span><span class=\"pun\">]&lt;</span><span class=\"pln\">data</span><span class=\"pun\">[</span><span class=\"pln\">j</span><span class=\"pun\">-</span><span class=\"lit\">1</span><span class=\"pun\">]){</span><span class=\"pln\">\r\n				tukar</span><span class=\"pun\">(</span><span class=\"pln\">j</span><span class=\"pun\">,</span><span class=\"pln\">j</span><span class=\"pun\">-</span><span class=\"lit\">1</span><span class=\"pun\">);</span>\r\n			<span class=\"pun\">}</span>\r\n		<span class=\"pun\">}</span><span class=\"pln\">\r\n		tampil</span><span class=\"pun\">();</span>\r\n	<span class=\"pun\">}</span><span class=\"pln\">\r\n	cout</span><span class=\"pun\">&lt;&lt;</span><span class=\"pln\">endl</span><span class=\"pun\">;</span>\r\n<span class=\"pun\">}</span>\r\n\r\n\r\n<span class=\"kwd\">int</span><span class=\"pln\"> main</span><span class=\"pun\">()</span>\r\n  <span class=\"pun\">{</span><span class=\"pln\">\r\n  	cout</span><span class=\"pun\">&lt;&lt;</span><span class=\"str\">\"ALGORITMA BUBBLE SORT\"</span><span class=\"pun\">&lt;&lt;</span><span class=\"pln\">endl</span><span class=\"pun\">;</span><span class=\"pln\">\r\n  	cout</span><span class=\"pun\">&lt;&lt;</span><span class=\"str\">\"----------------------\"</span><span class=\"pun\">&lt;&lt;</span><span class=\"pln\">endl</span><span class=\"pun\">;</span><span class=\"pln\">\r\n	input</span><span class=\"pun\">();</span><span class=\"pln\">\r\n	cout</span><span class=\"pun\">&lt;&lt;</span><span class=\"str\">\"Proses Bubble Sort\"</span><span class=\"pun\">&lt;&lt;</span><span class=\"pln\">endl</span><span class=\"pun\">;</span><span class=\"pln\">\r\n	tampil</span><span class=\"pun\">();</span><span class=\"pln\">\r\n	bubble_sort</span><span class=\"pun\">();</span><span class=\"pln\">\r\n  getch</span><span class=\"pun\">();</span>\r\n  <span class=\"pun\">}</span></code></pre>\r\n<h3>Hasil Output</h3>\r\n<div class=\"wp-block-image\">\r\n<figure class=\"aligncenter is-resized\"><img class=\"wp-image-4027\" src=\"https://kelasprogrammer.com/wp-content/uploads/2020/01/Contoh-Program-C-Bubble-Sort.png\" sizes=\"(max-width: 352px) 100vw, 352px\" srcset=\"https://kelasprogrammer.com/wp-content/uploads/2020/01/Contoh-Program-C-Bubble-Sort.png 469w, https://kelasprogrammer.com/wp-content/uploads/2020/01/Contoh-Program-C-Bubble-Sort-290x300.png 290w\" alt=\"contoh program c++ algoritma bubble sort\" width=\"352\" height=\"365\" /></figure>\r\n</div>\r\n<p>Perhatikan dari hasil output diatas pada tahap pertama data[1] dibandingkan dengan data lainnya, apabila data[1] lebih besar maka posisinya akan ditukar, jika dilihat data[1] lebih besar dari data[4] dan data[5] karena data[5] memili nilai yang paling rendah dibandingkan dengan data[4] maka posisi yang ditukar adalah dengan data[5]. Pada tahap kedua data[2] dibandingkan lagi dengan data-data lainnya didapati bahwa data[2] lebih besar dengan data[5] maka posisinya ditukar. Pada tahap ketiga data[3] dibandingkan dengan data[4] dan data[5], kalo dilihat data[3] memang tidak lebih besar dari data[4] dan data[5] sehingga proses berlanjut dengan membandingkan data[4] dan data[5] data[4] ternyata lebih besar dari data[5] sehingga posisinya ditukar. akhir kita menemukan hasil akhir dari proses pengurutan data dengan bubble sort dari deretan data 3-7-4-2-1 menjadi1-2-3-4-7.</p>', 2, NULL, 3, 'Sorting C++', '2020-06-22 19:00:11', 1, '1_HLGtY6O2vUHqIyEbWdmBgA.jpeg', 'a4', 'a4');
INSERT INTO `learning` VALUES (5, 89, 999, '<p>Searching adalah metode pencarian informasi dalam suatu aplikasi dengan suatu kunci (key). Pencarian diperlukan untuk mencari informasi khusus dari table pada saat lokasi yang pasti dari informasi tersebut sebelumnya tidak diketahui.<br /><a name=\"more\"></a><br />Pencarian selalu dinyatakan dengan referensi pada adanya sekelompok data yang tersimpan secara terorganisasi, kelompok data tersebut kita sebut table.<br />Pada metode searhcing (pencarian) ada 2 teknik yang digunakan yaitu :<br />Pencarian sekuensial (Sequential search) dan pencarian biner (Binary search).<br /><br /><strong>1. Pencarain sekuensial (sequential search)</strong><br />Pencarian sekuensial (sequensial search) atau sering disebut pencarian linier menggunakan prinsip sebagai berikut : data yang ada dibandingkan satu persatu secara berurutan dengan yang dicari.<br />Pada dasarnya, pencarian ini hanya melakukan pegulangan dari 1 sampai dengan jumlah data. Pada setiap perulangan, dibandingkan data ke-i dengan yang dicari. Apabila sama, berarti data telah ditemukan. Sebalikanya apabila sampai akhir pengulangan, tidak ada yang sama berarti data tidak ada.<br /><br />Algoritma Linear Searching</p>\r\n<ol>\r\n<li>Input x (data yang dicari)</li>\r\n<li>Bandingkan x dengan data ke-i sampai n</li>\r\n<li>Jika ada data yang sama dengan x maka cetak pesan \"ada\"</li>\r\n<li>Jika tidak ada data yang sama dengan x cetak pesan \"tidak ada\"</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>2. Pencarian Bagi Dua (Binary Search)</strong></div>\r\n<div>Salah satu keuntungan data yang terurut adalah memudah pencarian, yang dalam hal ini adalah pencarian bagi dua. Sebenarnya dalam kehidupan sehari-hari kita sering menerapkan algoritma ini. Untuk mencari kata tertentu dalam kamus (misalnya kamus bahasa inggris), kita tidak membuka kamus tersebut dari halaman awal sampai halaman akhir satu persatu, namaun kita mencari dengan cara membelah atau membagi halaman-halaman buku tersebut. Begitu seterusnya sampai kita menemukan kata yang dicari</div>\r\n<div><strong>? Langkah 1:</strong></div>\r\n<div>\r\n<div class=\"su-note\">\r\n<div class=\"su-note-inner su-clearfix\">Bagi 2 elemen larik pada elemen tengah. Elemen tengah adalah elemen dengan indeks k = (Ia+Ib) div 2. (Elemen tengah , L[K], membagi larik menajdi 2 bagian L [Ia...k-1] dan bagian kanan L[k+1...Ib])</div>\r\n</div>\r\n</div>\r\n<div><strong>?&nbsp;Langkah 2:</strong></div>\r\n<div>\r\n<div class=\"su-note\">\r\n<div class=\"su-note-inner su-clearfix\">Periksa apakah L[k]=X. Jika L[k]=X, pencarian dihentikan sebab X sudah ditemukan, tetapi jika tidak, harus ditentukan apakah pencarian pada larik bagian kiri atau larik bagian kanan. Jika L[k] &lt; X maka pencarian dilakukan pada larik kiri. Sebaliknya jika L[k]&gt;X maka pencarian dilakukan pada larik bagian kanan.</div>\r\n</div>\r\n</div>\r\n<div><strong>?&nbsp;Langkah 3:</strong></div>\r\n<div>\r\n<div class=\"su-note\">\r\n<div class=\"su-note-inner su-clearfix\">Ulangi langkah 1 sampai X atau Ia&gt;Ib.</div>\r\n</div>\r\n</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<h2 id=\"toc_2\">Contoh Program</h2>\r\n</div>\r\n<div>\r\n<div class=\"su-note\">\r\n<div class=\"su-note-inner su-clearfix\"><strong>Contoh ke-1 Program pencarian sekuensial menggunakan algoritma linier searching</strong></div>\r\n</div>\r\nCobalah program pencarian sekuensial dibawah ini menggunakan algoritma linier searching. Amati dan analisis program tersebut.</div>\r\n<div><strong>Source code :</strong><br />\r\n<pre>#include &lt;iostream&gt;<br /><br />using namespace std;<br /><br />main(){<br />    int i;<br />    int cari, ketemu;<br />    int A[100];<br /><br />    cout&lt;&lt;\"PROGRAM SEARCHING Liniear\\n\";<br />    cout&lt;&lt;\"masukan 7 buah data : \\n\\n\";<br />    for(i=1; i&lt;=7; i++)<br />    {<br />        cout&lt;&lt;\"masukan data ke-\"&lt;&lt;i&lt;&lt;\" = \";<br />        cin&gt;&gt;A[i];<br />    }<br />    cout&lt;&lt;endl;<br />    cout&lt;&lt;\"Input bilangan yang cari : \";cin&gt;&gt;cari;<br />    cout&lt;&lt;endl;<br /><br />    ketemu=0;<br />    for(i=0; i&lt;=7; i++)<br />    {<br />        if (A[i]==cari)<br />        {<br />            ketemu=1;<br />            cout&lt;&lt;\"Data ditemukan pada indeks ke-\"&lt;&lt;i&lt;&lt;endl;<br />        }<br />    }<br />    if(ketemu==0)<br />    {<br />        cout&lt;&lt;\"Data tidak ditemukan\"&lt;&lt;endl;<br />    }<br />}</pre>\r\n<div>\r\n<ul class=\"button\">\r\n<li><a class=\"demo\" href=\"http://cpp.sh/6dct5\" target=\"_blank\" rel=\"noopener\">DEMO</a></li>\r\n</ul>\r\n</div>\r\n<strong>Running program :</strong></div>\r\n<div><a href=\"https://3.bp.blogspot.com/-0NYtSUz0egA/XHu7EdSc7hI/AAAAAAAAFRo/c3ZRrc6ICaIEjtYcQhOFNm1SwdhxZrxFgCK4BGAYYCw/s1600/gbr1.png\"><img title=\"Program pencarian sekuensial menggunakan algoritma linier searching\" src=\"https://3.bp.blogspot.com/-0NYtSUz0egA/XHu7EdSc7hI/AAAAAAAAFRo/c3ZRrc6ICaIEjtYcQhOFNm1SwdhxZrxFgCK4BGAYYCw/s1600/gbr1.png\" alt=\"Program pencarian sekuensial menggunakan algoritma linier searching\" border=\"0\" /></a><br /><br /></div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<div class=\"su-note\">\r\n<div class=\"su-note-inner su-clearfix\"><strong>Contoh ke-2 Program pencarian biner (binary search)&nbsp;</strong></div>\r\n</div>\r\nCobalah program pencarian biner (binary search) sebagai implementasi algoritma binary search. Amati dan analisis program bersebut</div>\r\n<div>\r\n<div>\r\n<div><strong>Source code :</strong></div>\r\n<pre>#include &lt;iostream&gt;<br /><br />using namespace std;<br />main(){<br />    const int arraySize=5;<br />    int target;<br />    int array[arraySize]={1,2,3,4,5};<br />    int first, mid, last;<br /><br />    cout&lt;&lt;\"Masukan angka yang dicari: \";cin&gt;&gt;target;<br />    first=0; //Initialize first and last variables.<br />    last=2;<br /><br />    while(first&lt;=last)<br />    {<br />        mid=(first+last)/2;<br />        if(target&gt;array[mid])<br />        {<br />            first=mid+1;<br />        }else if(target&lt;array[mid])<br />        {<br />            last=mid+1;<br />        }else{<br />            first=last+1;<br />        }<br />    }<br />    if(target==array[mid])<br />    {<br />        cout&lt;&lt;\"Angka ditemukan.\"&lt;&lt;endl;<br />    }else{<br />        cout&lt;&lt;\"Angka tidak ditemukan.\"&lt;&lt;endl;<br />    }<br />}</pre>\r\n<div>\r\n<ul class=\"button\">\r\n<li><a class=\"demo\" href=\"http://cpp.sh/3ddvw\" target=\"_blank\" rel=\"noopener\">DEMO</a></li>\r\n</ul>\r\n</div>\r\n<div><strong>Running program :</strong></div>\r\n</div>\r\n</div>\r\n<div><a href=\"https://3.bp.blogspot.com/-bBqPzecDsMI/XHu7lOAp2FI/AAAAAAAAFR0/7mSqICk4QtYe-fVAbIVKJrgBf7z09ycgQCK4BGAYYCw/s1600/gbr1.png\"><img title=\"program pencarian biner (binary search) \" src=\"https://3.bp.blogspot.com/-bBqPzecDsMI/XHu7lOAp2FI/AAAAAAAAFR0/7mSqICk4QtYe-fVAbIVKJrgBf7z09ycgQCK4BGAYYCw/s1600/gbr1.png\" alt=\"program pencarian biner (binary search) \" border=\"0\" /></a></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<h2 id=\"toc_3\">Tugas</h2>\r\n</div>\r\n<div>\r\n<ol>\r\n<li>Buatlah algoritma dan program yang dapat mengecek apakah sebuah karakter ada dalam kata yang telah input ?</li>\r\n<li>Buatlah algoritma dan progam yang dapat mengecek apakah sebuah kata ada dalam kalimat yang telah input ?</li>\r\n<li>Buatlah algoritma dan program yang dapat menghitung banyakntya huruf vokal dan konsonan dalam sebuah kalaimat</li>\r\n<li>Modifikasi program soal nomor 4, selain menghitung banyaknya huruf vokal dan konsonan dalam sebuah kalimat, juga dapat menghitung banyaknya angka dalam kalimat tersebut.</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n</div>', 2, NULL, 3, 'Searching C++', '2020-06-22 19:02:36', 1, '1_HLGtY6O2vUHqIyEbWdmBgA.jpeg', 'a5', 'a5');
