siswa.jumlah_saudara,
siswa.jenis_kelamin,
siswa.saldo,
(select kelas from kelas where idkelas_fk = id_kelas) as kelas
FROM
(penerimaan
JOIN jenis_penerimaan ON (penerimaan.idjenispenerimaan_fk = jenis_penerimaan.id_jenis_penerimaan))
INNER JOIN siswa ON penerimaan.idsiswa_fk = siswa.id_siswa ;

